import XCTest
@testable import BitcoinSwift

class BTCMessageHandler_Tests: XCTestCase {
    
    override func setUp() {
        super.setUp()
        print("//////////////////// 测试开始 ////////////////////\n")
    }
    
    override func tearDown() {
        print("//////////////////// 测试结束 ////////////////////\n")
        super.tearDown()
    }
    
    
    /// 消息比特币网络协议消息
    func testDecodeMessage() {
        
        self.testVersion()
        
        self.testVerack()
        
        self.testMixMessage()
        
    }
    
    //MARK: - version
    func testVersion() {
        
        do {
            /*
             
             Message header:
             F9 BE B4 D9                                                                   - magic: main 网络
             76 65 72 73 69 6F 6E 00 00 00 00 00                                           - command: "version"
             55 00 00 00                                                                   - Payload 长度为 85 字节
             - version 消息中没有校验和
             Version message:
             9C 7C 00 00                                                                   - 31900 (版本 0.3.19)
             01 00 00 00 00 00 00 00                                                       - 1 (NODE_NETWORK services)
             E6 15 10 4D 00 00 00 00                                                       - Mon Dec 20 21:50:14 EST 2010
             01 00 00 00 00 00 00 00 00 00 00 00 00 00 00 00 00 00 FF FF 0A 00 00 01 DA F6 - 发送者地址信息 - 见 Network Address 一节
             01 00 00 00 00 00 00 00 00 00 00 00 00 00 00 00 00 00 FF FF 0A 00 00 02 20 8D - 接收者地址信息 - 见 Network Address 一节
             DD 9D 20 2C 3A B4 57 13                                                       - 节点的随机唯一 ID
             00                                                                            - "" 子版本字串 (字串长度为0)
             55 81 01 00                                                                   - 发送节点拥有的最新block是 #98645
             
             */
            
            let message = "F9BEB4D976657273696F6E0000000000550000009C7C00000100000000000000E615104D00000000010000000000000000000000000000000000FFFF0A000001DAF6010000000000000000000000000000000000FFFF0A000002208DDD9D202C3AB457130055810100".hexData!
            print("message.hex = \(message.hex)")
            let header = try BTCMessageHandler.decodeMessage(readData: message)
            print(header)
        } catch {
            XCTAssert(false, "\(error)")
        }
    }
    
    //MARK: - verack
    func testVerack() {
        
        do {
            /*
             
             Message header:
             F9 BE B4 D9                          - magic :main 网络
             76 65 72 61  63 6B 00 00 00 00 00 00 - command :"verack"
             00 00 00 00                          - Payload :长度为0                                                                 - 发送节点拥有的最新block是 #98645
             
             */
            
            let message = "F9BEB4D976657261636B00000000000000000000".hexData!
            print("message.hex = \(message.hex)")
            let header = try BTCMessageHandler.decodeMessage(readData: message)
            print(header)
        } catch {
            XCTAssert(false, "\(error)")
        }
    }
    
    //MARK: - addr
    func testAddr() {
        
        do {
            /*
             
             Message Header:
             F9 BE B4 D9                                     - magic ：main 网络
             61 64 64 72  00 00 00 00 00 00 00 00            - "addr"
             1F 00 00 00                                     - payload 长度31字节
             7F 85 39 C2                                     - payload 校验和
             
             Payload:
             01                                              - count : 1 消息中有1条地址
             
             Address:
             E2 15 10 4D                                     - Mon Dec 20 21:50:10 EST 2010 (only when version is >= 31402)
             01 00 00 00 00 00 00 00                         - 1 (NODE_NETWORK service - 见 [[#version]])
             00 00 00 00 00 00 00 00 00 00 FF FF 0A 00 00 01 - IPv4: 10.0.0.1, IPv6: ::ffff:10.0.0.1 (IPv4-mapped IPv6 address)
             20 8D                                           - 端口 8333
             
             */
            
            let message = "".hexData!
            print("message.hex = \(message.hex)")
            let header = try BTCMessageHandler.decodeMessage(readData: message)
            print(header)
        } catch {
            XCTAssert(false, "\(error)")
        }
    }
    
    //MARK: - 混合多条消息包处理
    func testMixMessage() {
        
        do {
            /*
             
             version verack version
             
             */
            
            let message = "".hexData!
            print("message.hex = \(message.hex)")
            let header = try BTCMessageHandler.decodeMessage(readData: message)
            print(header)
        } catch {
            XCTAssert(false, "\(error)")
        }
        
    }
}
